import * as React from "react";
// import './App.css';

import Profile from "./components/Profile";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Profile name="병덕" job="개발자" />
        <Profile name="병덕2" job="개발자2" />
      </div>
    );
  }
}

export default App;
